import { Router, Switch, Route} from 'react-router-dom';
import './App.css';
import Home from './pages/home'

function App() {
  return (
    <div className="App">
      <Router>
      <Switch>
        <Route path="/" component={home} />
      </Switch>
    </Router>
    </div>
  );
}

export default App;
